import { Link } from "react-router-dom";

const Navbar = () => {
  return (
    <header>
      <div className="flex container">
        <Link to="/">
          <h1>Work Out Buddy</h1>
        </Link>
        <Link to={`deptList`}>
          Department
        </Link>
        <Link to={`salaryList`}>
          Salary
        </Link>
      </div>
    </header>
  );
};

export default Navbar;
